// src/features/profile/Profile.js
import React from "react";
import { useSelector } from "react-redux";
import Navbar from "../components/Navbar/Navbar";
import Footer from "../components/Footer/Footer";
import UserHeader from "../components/User-Header/UserHeader";
import UserTransactions from "../components/User-Transactions/UserTransactions";

export default function Profile() {
  const user = useSelector((state) => state.auth.user); // Vérifier si user n'est pas null

  if (!user) {
    return <p>Loading user profile...</p>;
  }

  return (
    <div>
      <Navbar />
      <main className="main bg-dark user-page">
        <UserHeader user={user} />
        <UserTransactions user={user} />
      </main>
      <Footer />
    </div>
  );
}
